INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 24001, "リリ", 1, 2, 321, 40011, 0, 125801);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (2, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 24001, "クリア", 1, 2, 322, 40011, 0, 126001);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (3, "んーと。\nこれ、あげる。\nはい", 1, 24001, "プレシア", 1, 2, 323, 40011, 0, 126101);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (4, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 1, 24001, "リリ", 2, 2, 324, 40011, 0, 125801);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (5, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 1, 24001, "クリア", 2, 2, 325, 40011, 0, 126001);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (6, "お兄。\nきてくれて、うれしい", 1, 24001, "プレシア", 2, 2, 326, 40011, 0, 126101);
